import React from "react";
import "./navBar.css"
import logo from "./logo.png"

function NavBar() {



    return (
        <div className="navBarContainer">
            <ul className="navBar">
            <div className="logo"><img className="logoImg" src={logo} alt="logo"></img></div>
                <li classNam>JEU</li>
                <li>ACTUALITÉS</li>
                <li>COMMUNAUTÉ</li>
                <li>ASSISTANCE</li>
            </ul>
            <button className="packBtn">Acheter le pack fondateur</button>
        </div>
    )
}

export default NavBar;
